import React from 'react';
import Header from './Header';
import QuestionCard from './QuestionCard';
import FooterForm from './FooterForm';
import Data from './data'
import './App.css';

function App() {

  return (
    <div>
      <Header />
      <QuestionCard data={this.Data.questions}/>
      <FooterForm />
    </div>
  );
}

export default App;
